import classes from "./ExpenseItem.module.css";

const ExpenseItem = () => {
  const expenseDate = new Date(2022, 13, 23).toString();

  return (
    <div className={classes["expense-item"]}>
      <div>{expenseDate}</div>
      <div className={classes["expense-item__description"]}>
        <h2>Title</h2>
        <div className={classes["expense-item__price"]}>&#x20B9 Amount</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
